import React, { useState, useEffect } from "react";
import "./SkillSet.scope.css";
import "./saturn.scope.css"
import { Animator, ScrollContainer, ScrollPage, batch, Fade, FadeIn, FadeOut, Move, MoveIn, MoveOut, Sticky, StickyIn, StickyOut, Zoom, ZoomIn, ZoomOut } from "react-scroll-motion";
const Spin = (cycle) =>
  ({
    in: {
      style: {
        // `p` is number (0~1)
        // When just before this page appear, `p` will be 0
        // When this page filled your screen, `p` will be 1
        transform: (p) => `rotate(${p * 360 * cycle}deg)`,
      },
    },
    out: {
      style: {
        // `p` is number (0~1)
        // When this page filled your screen, `p` will be 0
        // When just after this page disappear, `p` will be 1
        transform: (p) => `rotate(${p * 360 * cycle}deg)`,
      },
    },
  });

const ZoomInScrollOut = batch(StickyOut(35,50), ZoomOut(), Spin(3))

const SkillSlider = () => {


  return (
    <section className="container-page">
      <div className="section-center">

        <ScrollContainer>
        <ScrollPage>
          <Animator animation={ZoomInScrollOut}>
            <div id="saturn">
              <div className="devops">
                <img className='w-5 inset-x-48 absolute' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1634225451/tech%20stack/redis_agonqb.svg' alt='redis'/>
                <img className='w-5 inset-x-48 absolute' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1634225443/tech%20stack/docker-icon_hamwmv.svg' alt='docker'/>
                <img className='w-5 top-32 right-32 absolute' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1634225440/tech%20stack/jenkins_xhlzk0.svg' alt='jenkins'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1635367893/tech%20stack/kubernetes_qyuz5v.svg' alt='k8s'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1673532040/tech%20stack/k6_u6c2ec.png' alt='k6'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1673531797/tech%20stack/bash-icon_ptejqi.svg' alt='bash'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1634225449/tech%20stack/nginx_sapsks.svg' alt='nginx'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1676619182/tech%20stack/terraform-icon_ly3tzy.svg' alt='terraform'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1676256028/tech%20stack/aws_zybwtn.svg' alt='aws'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1673531564/tech%20stack/prometheus_br1pba.svg' alt='prometheus'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1673531635/tech%20stack/grafana_tugzn3.svg' alt='grafana'/>
              </div>
              <div className="backend">
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1673531926/tech%20stack/odoo_iygocm.png' alt='odoo'/>  
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1634289445/tech%20stack/express_xmzka6.svg' alt='expressjs'/>
              </div>
              <div className="frontend">
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1634191162/tech%20stack/react_xh8uvp.svg' alt='reactjs'/>
              </div>
              <div className="programming-language">   
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1673531825/tech%20stack/javascript_oel9ub.svg' alt='js'/>
                <img className='w-5' src='https://res.cloudinary.com/dvehyvk3d/image/upload/v1676255956/tech%20stack/python_shauaa.svg' alt='python'/>
              </div>
              <div class="planet bottom planet-bg"></div>
              {/* <div class="rings" ></div> */}
            <div class="planet top planet-bg"></div>
          </div>
          </Animator>
        </ScrollPage>
        </ScrollContainer>


      </div>
    </section>
  );
};

export default SkillSlider;
